    "Greenland 5 km DEM, Ice Thickness, and Bedrock Elevation Grids",nt"tracking_summary":
    {ntt"total": 23,ntt"recent": 3nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-07-08T19:25:13.701370",nt"name": "greenland-5-km-dem-ice-thickness-and-bedrock-elevation-grids",nt"isopen":
    true,nt"url": null,nt"notes": "A Digital Elevation Model (DEM), ice thickness
    grid, and bedrock elevation grid of Greenland acquired as part of the PARCA program
    are available in ASCII text format at a 5 km grid spacing in a polar stereographic
    projection. DEM data are a combination of ERS-1 and Geosat satellite radar altimetry
    data, Airborne Topographic Mapper (ATM) data, and photogrammetric digital height
    data. Ice thickness data are based on approximately 700,000 data points collected
    in the 1990s from a University of Kansas airborne ice penetrating radar (IPR). Nearly
    30,000 data points were collected in the 1970s from a Technical University of Denmark
    (TUD) airborne echo sounder. Bamber subtracted the ice thickness grid from the DEM
    to produce a grid of bedrock elevation values. Applications include studies of gravitational
    driving stress and ice volume (mass balance) of the Greenland Ice Sheet. Each of
    the three grids is approximately 1.5 MB. Data are available via FTP. Data access
    is unrestricted, but we recommend that users register with us. Registered users
    automatically receive e-mail notification of product updates and changes to processing.",nt"license_title":
